class Solution(object):
    def lengthOfLongestSubstring(self, str):
        if len(str) == 0:
            return 0
        elif len(str) == 1:
            return 1

        maxStr = ''
        subStr = ''
        for index, item in enumerate(str):
            if item not in subStr:
                subStr = subStr + item
                # if index == len(str):
                #     return maxStr
            else:
                if len(subStr) > len(maxStr):
                    maxStr = subStr
                i = str[0:index].rindex(item)
                subStr = str[i + 1 : index + 1]
            if len(subStr) > len(maxStr):
                maxStr = subStr

        return len(maxStr)

